#include <stdio.h>
#include <stdlib.h>
#define DIMENSAO 400

void multiplica(int a[DIMENSAO][DIMENSAO], int b[DIMENSAO][DIMENSAO],
		int resultado[DIMENSAO][DIMENSAO], int linhasA, int colunasA, int linhasB, int colunasB)
{
	int i, j,k, temp;
	for(i = 0; i < linhasA; i++){
		for(j = 0; j < colunasB; j++){
			temp = 0;
			for(k = 0; k < colunasA; k++){
				temp += a[i][k]*b[k][j];
			}
			resultado[i][j] = temp;
		}
	}
}

void exibir(int a[DIMENSAO][DIMENSAO], int linhas, int colunas)
{
	int i, j;
	for(i = 0; i < linhas; i++){
		for(j = 0; j < colunas; j++){
			printf("%d\t", a[i][j]);
		}
		printf("\n");
	}
}
void transposta(int x[DIMENSAO][DIMENSAO], int t[DIMENSAO][DIMENSAO], int linhas, int colunas){
	int i, j;
	for (i = 0; i < linhas; i = i + 1){
		for (j = 0; j < colunas; j = j + 1){
			t[j][i] = x[i][j];
		}
	}
}

